import React, { useState } from 'react';
import './DeliveryQueue.css';

const mockQueue = [
    { id: 101, destino: '25,15', peso: 1.2, prioridade: 'media' },
    { id: 102, destino: '-40,30', peso: 0.5, prioridade: 'media' },
    { id: 103, destino: '2,9', peso: 0.25, prioridade: 'alta' },
];

function DeliveryQueue() {
    const [queue, setQueue] = useState(mockQueue);

    return (
        <div className="queue-container">
            <h2>Fila de Pedidos Pendentes</h2>
            <ul>
                {queue.map(item => (
                    <li key={item.id} className={`prioridade-${item.prioridade}`}>
                        <strong>Pedido #{item.id}</strong> - Destino: ({item.destino}), Peso: {item.peso}kg
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default DeliveryQueue;
